import pinImage from "../images/pinImage.png";
import crab1 from "../images/crab1.png";
import crab2 from "../images/crab2.png";
import crab3 from "../images/crab3.png";
import crab4 from "../images/crab4.png";

const pinData = {
  "Crab 1": {
    lon: -123.103767,
    lat: 49.273251,
    pinImage: pinImage,
    crabImage: crab1,
  },
  "Crab 2": {
    lon: -123.1035,
    lat: 49.273,
    pinImage: pinImage,
    crabImage: crab2,
  },
  "Crab 3": {
    lon: -123.1032,
    lat: 49.273,
    pinImage: pinImage,
    crabImage: crab3,
  },
  "Crab 4": {
    lon: -123.1029,
    lat: 49.273,
    pinImage: pinImage,
    crabImage: crab4,
  },
};

export default pinData;
